import React from 'react';
const style = {
    width: "17rem"
}

function SmallCard(props){
    console.log(props)
    return(
        <div className="col col-md-6 ml-5">
                <div className="card mt-3" style={style}>
                    <img className="card-img-top" src={props.item.urlToImage} alt="Card image cap" />
                    <div className="card-body">
                        <h5 className="card-title">{props.articles.title}</h5>
                        <p className="card-text">{props.item.content}</p>
                    </div>
                </div>
            </div>
    )
}
export default SmallCard;
